import React from "react";
import TodoItem from "./TodoItem";
function TodoList({list ,selected}) {
  return (
    <div className="todo-container">
      <ul className="todo-list">
          <TodoItem items={list} selected={selected}/>
      </ul>
    </div>
  );
}

export default TodoList;
